import './App.css';
import { useEffect } from 'react';

function App() {

  useEffect(() => {
    getQuote();
  }, []);

  const getQuote = () => {
    fetch('https://api.quotable.io/random')
      .then((response) => { return response.json();
      })
      .then((data) => {
        console.log(data);
      });
  }

  return (
    <div className="App">App
      <div id="quote-box">
        <p id="text"></p>
        <p id="author"></p>
        <button id="new-quote" >New Quote</button>
        <a id="tweet-quote"></a>
      </div>
    </div>
  );
}

export default App;
